import Navbar from './navbar'


const layout = (props)=>(
    <div>
        <link rel="stylesheet" href="https://bootswatch.com/4/cerulean/bootstrap.min.css"/>
        <head>
            <title>the brongondyte</title>
        </head>
        <Navbar/>
        {props.children}
    </div>
)


export default layout;
